import { useQuery } from "@tanstack/react-query";
import axios from "axios";
import moment from "moment";
import { useContext, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../../contexts/authContext.js";
import { baseURL } from "../../utils/constants.js";
import Post from "../post/post.js";
import Write from "../post/write.js";

const url = baseURL;

const HomeFeed = () => {
    const { currentUser } = useContext(AuthContext);
    const navigate = useNavigate();

    const { isFetched, data: posts } = useQuery(['posts'], () => 
        axios.get(url + '/posts/', {
            params: {
                id: currentUser.id
            }
        }).then(res => res.data.map(post => ({
            ...post, 
            ingredients: JSON.parse(post.ingredients),
            date: moment(post.date).format('YYYY-MM-DD HH:mm:ss')
        })
    )))

    useEffect(() => {
        !currentUser && navigate('/login');
    }, [])
    
    return(
        <>
            {isFetched ? 
                posts.map(post => 
                    <Post key={post.id} postObj={post}/>
                )
                :
                <>
                </>
            }
        </>
    )
}

export default HomeFeed;
